import React, { Component } from 'react';

class Auth extends Component {
  componentDidMount() {
    this.props.explandContentArea();
  }

  inputChangedHandler(event, inputIdentifier) {
    const updatedLoginForm = {
      ...this.state.LoginForm,
      [inputIdentifier]: {
        ...this.state.LoginForm[inputIdentifier],
        value: event.target.value,
        valid: this.checkValidity(event.target.value, this.state.LoginForm[inputIdentifier].validation),
        touched: true
      }
    }

    this.setState({LoginForm: updatedLoginForm});
  }

  LoginHandler(event) {
    event.preventDefault();

    this.props.onAuth(this.state.LoginForm.email.value, this.state.LoginForm.password.value);
  }

  onChange(event) {
    const wallet_address_files = event.target.files;
    // this.setState({wallet_address: wallet_address});
    
    this.props.setWalletAddress(wallet_address_files);
  }   

  render() {

    let form = (<div className="col-xl-4 col-lg col-md-4 col-sm-4 col-12 margin-auto margin-top-20">
                  <div className="custom-file">
                    <input type="file" name="keyfile" className="custom-file-input" onChange={(e) => this.onChange(e)} />
                    <label className="custom-file-label custom-file-label-primary" htmlFor="customFile2">Choose file</label>
                  </div>
                </div>);

    if(this.props.loading) {
      form = <span>Loading your wallet ...</span>
    }

    return (<>

      <div className="padding-15">
        <img className="logo-large" src="data:image/png;base64,
" />
        <div className="login-box">


          <form onSubmit={(event) => this.LoginHandler(event)} className="sky-form boxed margin-bottom-300">
            <header><i className="fa fa-cloud-download"></i>  Connect Your AR Wallet</header>
                      
                      
            <fieldset className='margin-bottom-50'>
                          <section className="white">Please select your <strong>AR wallet</strong> file to connect and start using <strong>The Arweave Crypto Technical Analysis Portal</strong></section>
              {form}

            </fieldset>

            <footer>
              <div className="forgot-password pull-left">
                  <a href="https://tokens.arweave.org/" className="white btn btn-info" target="_blank">Dont have a wallet? or need some FREE AR coins? Click Here!</a>
              </div>
            </footer>
          </form>


        </div>

		</div>
    </>
    );
  }
}


export default Auth;
